import React from 'react';
import {ProductComponent} from './product.component'
export class ShoppingCart extends React.Component{
    
    constructor(){
        super();
        this.products =[ 
            {name:'Iphone7',price:40000,quantity:50,stock:'true',image:'data:image/jpeg;base64,'},
            {name:'Motorola',price:15000,quantity:4,stock:'true',image:'data:image/jpeg;base64,'},
            {name:'MI A1',price:20000,quantity:15,stock:"true",image:'data:image/jpeg;base64,'},
            {name:'Samsung',price:12000,quantity:20,stock:"true",image:'data:image/jpeg;base64,'}
    ];
        
   
    }
    
    
    render(){

        var listOfProductComponent = this.products.map(function(product,index){
                return <ProductComponent productdetails={product} key={index+1} />            
        });

        return <div>
            {listOfProductComponent}
                 </div>
    }
}